  return (
    <Container className="news">
      <a href={data.urlToImage}>
        <Row className="news__image">
          <img src={data.urlToImage} atl="image" width="350" height="200" />
        </Row>
      </a>
      <br />
      <Row className="news__title">{data.title}</Row>
      <Row className="news__desc">{data.description} </Row>
      <Row className="news__url">
        {" "}
        {"\u00A0"}{" "}
        <a href={data.url} target="_blank">
          {" "}
          Read More..{" "}
        </a>{" "}
      </Row>
      <Row className="news__author">
        Author: {"\u00A0"} {"\u00A0"} {data.author}
      </Row>{" "}
      <br />
      <Row className="news__published">
        Date Pub: {"\u00A0"} {data.publishedAt}
      </Row>{" "}
      <br />
      <Row className="news__source">
        Source: {"\u00A0"} {"\u00A0"} {"\u00A0"} {data.source.name}
      </Row>{" "}
      <br />
    </Container>
  );
}

export default NewsArticle;
